import Vue from 'vue';
import VueRouter from 'vue-router';
import HomePage from './views/HomePage.vue';
import AdminPage from './views/AdminPage.vue';

Vue.use(VueRouter);

const router = new VueRouter(

  {
    path: '/',
    name: 'home',
    component: HomePage,
  },
  {
    path: '/admin',
    name: 'admin',
    component: AdminPage,
  },
);


export default router;
